import React from 'react';
import './App.css';
import Navbar from './componentes/Navbar';
import Empresa from './componentes/Empresa';

import Foto1 from './imgs/foto1.jpg';
import Foto2 from './imgs/foto2.jpg';
import Foto3 from './imgs/foto3.jpg';
function App() {
  return (
    <div>
       <div class= 'recuadro-empresa'>
      <div class='row'>
        <div class=''>
        <div id="fotos" class="carousel carousel-empresa slide" data-ride="carousel">


          <div class="carousel-inner">
            <div class="carousel-item active">
              <img src={Foto1} class='foto' alt="Foto1"/>
            </div>
            <div class="carousel-item">
              <img src={Foto2} class='foto' alt="Foto2"/>
            </div>
            <div class="carousel-item">
              <img src={Foto3} class='foto' alt="foto3"/>
            </div>
          </div>
          <a class="carousel-control-prev" href="#fotos" data-slide="prev">
            <span class="carousel-control-prev-icon"></span>
          </a>
          <a class="carousel-control-next" href="#fotos" data-slide="next">
            <span class="carousel-control-next-icon"></span>
          </a>
          </div>
        </div>
      </div>
    </div>
    </div>
  );
}

export default App;
